import React, {Component} from "react";
import Item from "./Item"
import './styles.css'

export default function ItemList({items}) {
    const itemElements = items.map(item =>
        <li key={item.id} className="item-list__li"><Item item = {item}/></li>);
    return(
        <ul>
            {itemElements}
        </ul>
    )
}
